description:
Three helicopters -- the HH-65A Dauphin, the Sikorsky SH-3 Sea King, and the BK-117 C-1 -- are selectable, each with realistic cockpit controls, landing gear, spotlights, divers, and hoist lines. Gameplay modes include career mode, random maps, and customizable missions. 

